// import { Link, Switch, Route } from 'react-router-dom';
import './NavMenu.css';

class NavMenu extends Component {
    render() {
        return (
            <div className='NavMenuStyle'>
                {/* TODO: turn these into links */}
                {/* TODO: align w/ main title */}
                <p>about</p>
                <p>blogs</p>
                <p>instagram</p>
                <p>twitter</p>
                <p>facebook</p>
                <p>youtube</p>
            </div>
        )
    }
}

export default NavMenu;
